patch:
diff --git a/Include/object.h b/Include/object.h
index 3876d8449af..0a382bc87ba 100644
--- a/Include/object.h
+++ b/Include/object.h
@@ -245,7 +245,6 @@ _Py_IsOwnedByCurrentThread(PyObject *ob)
 #endif
 }
 #endif
-
 // Py_TYPE() implementation for the stable ABI
 PyAPI_FUNC(PyTypeObject*) Py_TYPE(PyObject *ob);

@@ -253,20 +252,23 @@ PyAPI_FUNC(PyTypeObject*) Py_TYPE(PyObject *ob);
     // Stable ABI implements Py_TYPE() as a function call
     // on limited C API version 3.14 and newer.
 #else
-    static inline PyTypeObject* _Py_TYPE(PyObject *ob)
-    {
-        return ob->ob_type;
+#include "pyerrors.h"  // Ensure Py_FatalError is declared before use
+static inline PyTypeObject* _Py_TYPE(PyObject *ob)
+{
+    if (ob == NULL) {
+        Py_FatalError("_Py_TYPE called with NULL pointer");
     }
-    #if !defined(Py_LIMITED_API) || Py_LIMITED_API+0 < 0x030b0000
-    #   define Py_TYPE(ob) _Py_TYPE(_PyObject_CAST(ob))
-    #else
-    #   define Py_TYPE(ob) _Py_TYPE(ob)
-    #endif
+    return ob->ob_type;
+}
+#if !defined(Py_LIMITED_API) || Py_LIMITED_API+0 < 0x030b0000
+#   define Py_TYPE(ob) _Py_TYPE(_PyObject_CAST(ob))
+#else
+#   define Py_TYPE(ob) _Py_TYPE(ob)
+#endif
 #endif

 PyAPI_DATA(PyTypeObject) PyLong_Type;
 PyAPI_DATA(PyTypeObject) PyBool_Type;
-
 // bpo-39573: The Py_SET_SIZE() function must be used to set an object size.
 static inline Py_ssize_t Py_SIZE(PyObject *ob) {
     assert(Py_TYPE(ob) != &PyLong_Type);
